import graphic from '../img/graphic.png';

function Home() {
    return (
        <div className="home">
            <div className="container">
                <div className="row align-items-center">
                    <div className="hero-text col-lg-5">
                        <h1 className="headline font-weight-bold">Hi, <br />I'm Riley.</h1>
                        <p className="lead font-weight-light mt-4">A web developer</p>
                        <button className="btn btn-blue mt-4">See My Work</button>
                    </div>
                    <div className="col-lg-7 d-flex justify-content-end align-items-start">
                        <img
                            className="graphic img-fluid rounded"
                            src={graphic}
                            alt="..."
                        />
                    </div>
                </div>
            </div>
        </div >
    );
}

export default Home;
